import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Your automation logic here
    // Use a specific XPath selector to find a product card generated by the script
    const productCardXPath = '//div[contains(@class, "product-card") and .//h3[contains(text(), "Instant Pot Duo")]]';

    // Wait for the product card to be visible on the page
    await page.waitForSelector(productCardXPath, { timeout: 5000 });

    // Click on the product card to open the detail modal
    await page.locator(productCardXPath).click();

    // Wait for the modal to become visible (its display style is set to 'block')
    const modalSelector = '#productModal[style*="display: block"]';
    await page.waitForSelector(modalSelector, { timeout: 5000 });

    // Take a screenshot of the opened modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_opened.png'));

    // Extract data from the modal to verify the action
    const modalTitle = await page.locator(`${modalSelector} .product-detail-title`).textContent();
    const modalPrice = await page.locator(`${modalSelector} .product-detail-price`).textContent();

    return {
      success: true,
      action: "Opened the product detail modal for 'Instant Pot Duo'",
      extractedData: {
        productTitleInModal: modalTitle.trim(),
        productPriceInModal: modalPrice.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
